function HelloDiv() {
  return <div>
  <h1>Hello! My name is Human</h1>
  <ul>
    <li>Pineapples</li>
    <li>but not</li>
    <li>on pizza</li>
  </ul>
  </div>;
}

export default HelloDiv;
